    <p>{`Find tutorials, examples and technical articles that will help you to develop with Redis and Java.`}</p>
    <h2 {...{
      "id": "getting-started"
    }}>{`Getting Started`}</h2>
    <p>{`Java community has built many client libraries that you can find `}<a parentName="p" {...{
        "href": "https://redis.io/clients#java"
      }}>{`here`}</a>{`. For your first steps with Java and Redis, this article will show how to use the two main libraries: `}<a parentName="p" {...{
        "href": "https://github.com/redis/jedis"
      }}>{`Jedis`}</a>{` and `}<a parentName="p" {...{
        "href": "https://lettuce.io/"
      }}>{`Lettuce`}</a>{`.`}</p>
    <p>{`The blog post “`}<a parentName="p" {...{
        "href": "https://redislabs.com/blog/jedis-vs-lettuce-an-exploration/"
      }}>{`Jedis vs. Lettuce: An Exploration`}</a>{`” will help you to select the best for your application; keeping in mind that both are available in Spring & SpringBoot framework.`}</p>
    <Tabs defaultValue="jedis" values={[{
      label: 'Jedis',
      value: 'jedis'
    }, {
      label: 'Lettuce',
      value: 'lettuce'
    }]} mdxType="Tabs">
  <TabItem value="jedis" mdxType="TabItem">
        <h2 {...{
          "id": "using-jedis"
        }}>{`Using Jedis`}</h2>
        <h3 {...{
          "id": "step-1-add-dependencies-jedis-dependency-to-your-maven-or-gradle-project-file"
        }}>{`Step 1. Add dependencies Jedis dependency to your Maven (or Gradle) project file:`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-xml"
          }}>{` <dependency>
     <groupId>redis.clients</groupId>
     <artifactId>jedis</artifactId>
     <version>3.4.0</version>
 </dependency>
`}</code></pre>
        <h3 {...{
          "id": "step-2-import-the-required-classes"
        }}>{`Step 2. Import the required classes`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-java"
          }}>{` import redis.clients.jedis.*;
`}</code></pre>
        <h3 {...{
          "id": "step-3-create-a-connection-pool"
        }}>{`Step 3. Create a Connection Pool`}</h3>
        <p>{`Once you have added the Jedis library to your project and imported the necessary classes you can create a connection pool.`}</p>
        <p>{`You can find more information about Jedis connection pool in the `}<a parentName="p" {...{
            "href": "https://github.com/redis/jedis/wiki/Getting-started#basic-usage-example"
          }}>{`Jedis Wiki`}</a>{`. The connection pool is based on the `}<a parentName="p" {...{
            "href": "http://commons.apache.org/proper/commons-pool/apidocs/org/apache/commons/pool2/impl/GenericObjectPoolConfig.html"
          }}>{`Apache Common Pool 2.0 library`}</a>{`.`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-java"
          }}>{`  JedisPool jedisPool = new JedisPool(new JedisPoolConfig(), "localhost", 6379);
`}</code></pre>
        <h3 {...{
          "id": "step-4-write-your-application-code"
        }}>{`Step 4. Write your application code`}</h3>
        <p>{`Once you have access to the connection pool you can now get a Jedis instance and start to interact with your Redis instance.`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-java"
          }}>{`  // Create a Jedis connection pool
  JedisPool jedisPool = new JedisPool(new JedisPoolConfig(), "localhost", 6379);

  // Get the pool and use the database
  try (Jedis jedis = jedisPool.getResource()) {

  jedis.set("mykey", "Hello from Jedis");
  String value = jedis.get("mykey");
  System.out.println( value );

  jedis.zadd("vehicles", 0, "car");
  jedis.zadd("vehicles", 0, "bike");
  Set<String> vehicles = jedis.zrange("vehicles", 0, -1);
  System.out.println( vehicles );

  }

  // close the connection pool
  jedisPool.close();
`}</code></pre>
        <p>{`Find more information about Java & Redis connections in the "`}<a parentName="p" {...{
            "href": "https://github.com/redis-developer/redis-connect/tree/master/java/jedis"
          }}>{`Redis Connect`}</a>{`".`}</p>
  </TabItem>
  <TabItem value="lettuce" mdxType="TabItem">
        <h2 {...{
          "id": "using-lettuce"
        }}>{`Using Lettuce`}</h2>
        <h3 {...{
          "id": "step-1-add-dependencies-jedis-dependency-to-your-maven-or-gradle-project-file-1"
        }}>{`Step 1. Add dependencies Jedis dependency to your Maven (or Gradle) project file:`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-xml"
          }}>{` <dependency>
    <groupId>io.lettuce</groupId>
    <artifactId>lettuce-core</artifactId>a
     <version>6.0.1.RELEASE</version>
 </dependency>
`}</code></pre>
        <h3 {...{
          "id": "step-2-import-the-jedis-classes"
        }}>{`Step 2. Import the Jedis classes`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-java"
          }}>{` import io.lettuce.core.RedisClient;
 import io.lettuce.core.api.StatefulRedisConnection;
 import io.lettuce.core.api.sync.RedisCommands;
`}</code></pre>
        <h3 {...{
          "id": "step-3-write-your-application-code"
        }}>{`Step 3. Write your application code`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-java"
          }}>{`  RedisClient redisClient = RedisClient.create("redis://localhost:6379/");
  StatefulRedisConnection<String, String> connection = redisClient.connect();
  RedisCommands<String, String> syncCommands = connection.sync();

  syncCommands.set("mykey", "Hello from Lettuce!");
  String value = syncCommands.get("mykey");
  System.out.println( value );

  syncCommands.zadd("vehicles", 0, "car");
  syncCommands.zadd("vehicles", 0, "bike");
  List<String> vehicles = syncCommands.zrange("vehicles", 0, -1);
  System.out.println( vehicles );

  connection.close();
  redisClient.shutdown();
`}</code></pre>
        <p>{`Find more information about Java & Redis connections in the "`}<a parentName="p" {...{
            "href": "https://github.com/redis-developer/redis-connect/tree/master/java/lettuce"
          }}>{`Redis Connect`}</a>{`".`}</p>
  </TabItem>
    </Tabs>
    <h3 {...{
      "id": "redis-launchpad"
    }}>{`Redis Launchpad`}</h3>
    <p>{`Redis Launchpad is like an “App Store” for Redis sample apps. You can easily find apps for your preferred frameworks and languages.
Below are few of these apps. `}<a parentName="p" {...{
        "href": "https://launchpad.redis.com"
      }}>{`Click here to access the complete lists of apps`}</a></p>
    <div class="row text--center">
      <div class="col ">
        <div className="ri-container">
          <h4 {...{
            "id": "movie-database-app-in-java"
          }}>{`Movie Database app in Java`}</h4>
          <p><img alt={"launchpad"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/moviedatabasejava.png").default} /></p>
          <p><a parentName="p" {...{
              "href": "http://launchpad.redis.com/?id=project%3Ademo-movie-app-redisearch-java"
            }}>{`Movie Database app in Java`}</a>{` based on RediSearch capabilities`}</p>
        </div>
      </div>
      <div class="col">
        <div className="ri-container">
          <h4 {...{
            "id": "leaderboard-app-in-java"
          }}>{`Leaderboard app in Java`}</h4>
          <p><img alt={"launchpad"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/basicleaderboardjava.png").default} /></p>
          <p><a parentName="p" {...{
              "href": "http://launchpad.redis.com/?id=project%3Abasic-redis-leaderboard-demo-java"
            }}>{`How to implement leaderboard app`}</a>{` using Redis & Java(Spring)`}</p>
        </div>
      </div>
    </div>
    <h3 {...{
      "id": "ecosystem"
    }}>{`Ecosystem`}</h3>
    <p>{`As developer you can use the Java client library directly in your application, or you can frameworks like: `}<a parentName="p" {...{
        "href": "https://spring.io/"
      }}>{`Spring`}</a>{`, `}<a parentName="p" {...{
        "href": "https://quarkus.io/"
      }}>{`Quarkus`}</a>{`,  `}<a parentName="p" {...{
        "href": "https://vertx.io/"
      }}>{`Vert.x`}</a>{`, and `}<a parentName="p" {...{
        "href": "https://micronaut.io/"
      }}>{`Micronaut`}</a>{`.`}</p>
    <div class="row text--center">
      <div class="col ">
        <div className="ri-container">
          <h4 {...{
            "id": "develop-with-spring"
          }}>{`Develop with Spring`}</h4>
          <p><img alt={"Spring logo"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!/Users/ajeetraina/projects/8sep/redis-developer.github.io/static/img/logos/spring.png").default} /></p>
          <p><a parentName="p" {...{
              "href": "https://spring.io/projects/spring-data-redis"
            }}>{`Spring Data Redis`}</a>{`, part of the larger Spring Data project. It provides easy access to Redis from Spring applications.`}</p>
        </div>
      </div>
      <div class="col">
        <div className="ri-container">
          <h4 {...{
            "id": "develop-with-quarkus"
          }}>{`Develop with Quarkus`}</h4>
          <p><img alt={"Quarkus logo"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!/Users/ajeetraina/projects/8sep/redis-developer.github.io/static/img/logos/quarkus.png").default} /></p>
          <p><a parentName="p" {...{
              "href": "https://quarkus.io/guides/redis"
            }}>{`Redis Client extension`}</a>{` allows you to connect your Quarkus application to a Redis instance.`}</p>
        </div>
      </div>
    </div>
    <div class="row text--center">
      <div class="col">
        <div className="ri-container">
          <h4 {...{
            "id": "develop-with-vertx"
          }}>{`Develop with Vert.x`}</h4>
          <p><img alt={"Vert.x logo"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!/Users/ajeetraina/projects/8sep/redis-developer.github.io/static/img/logos/vertx.png").default} /></p>
          <p><a parentName="p" {...{
              "href": "https://vertx.io/introduction-to-vertx-and-reactive/"
            }}>{`Eclipse Vert.x`}</a>{` is a framework to build reactive applications on the JVM. `}<a parentName="p" {...{
              "href": "https://vertx.io/docs/vertx-redis-client/java/"
            }}>{`Vert.x-redis`}</a>{` is redis client to be used with Vert.x.`}</p>
        </div>
      </div>
      <div class="col">
        <div className="ri-container">
          <h4 {...{
            "id": "develop-with-micronaut"
          }}>{`Develop with Micronaut`}</h4>
          <p><img alt={"Micronaut logo"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!/Users/ajeetraina/projects/8sep/redis-developer.github.io/static/img/logos/micronaut.svg").default} /></p>
          <p><a parentName="p" {...{
              "href": "https://micronaut.io/"
            }}>{`Micronaut`}</a>{` is a framework for building microservices and serverless applications. The `}<a parentName="p" {...{
              "href": "https://micronaut-projects.github.io/micronaut-redis/snapshot/guide/"
            }}>{`Micronaut Redis`}</a>{` extension provides the integration with Redis.`}</p>
        </div>
      </div>
    </div>
    <hr></hr>
    <h3 {...{
      "id": "more-developer-resources"
    }}>{`More developer resources`}</h3>
    <div class="row">
      <div class="col">
        <h4 {...{
          "id": "sample-code"
        }}>{`Sample Code`}</h4>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://github.com/redis-developer/brewdis"
            }}>{`Brewdis - Product Catalog (Spring)`}</a></strong>{`
See how to use Redis and Spring to build a product catalog with streams, hashes and RediSearch`}</p>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://github.com/redis-developer/redis-streams-in-action"
            }}>{`Redis Stream in Action (Spring)`}</a></strong>{`
See how to use Spring to create multiple producer and consumers with Redis Streams`}</p>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://github.com/redis-developer/vertx-rate-limiting-redis"
            }}>{`Rate Limiting with Vert.x`}</a></strong>{`
See how to use Redis Sorted Set with Vert.x to build a rate limiting service.`}</p>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://github.com/redis-developer/vertx-rate-limiting-redis"
            }}>{`Redis Java Samples with Lettuce`}</a></strong>{`
Run Redis Commands from Lettuce`}</p>
      </div>
      <div class="col col--1">
      </div>
      <div class="col">
        <h4 {...{
          "id": "technical-articles"
        }}>{`Technical Articles`}</h4>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://redislabs.com/blog/getting-started-with-redis-streams-and-java/"
            }}>{`Getting Started with Redis Streams and Java (Lettuce)`}</a></strong></p>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://redislabs.com/blog/jedis-vs-lettuce-an-exploration/https://redislabs.com/blog/jedis-vs-lettuce-an-exploration/"
            }}>{`Jedis vs. Lettuce: An Exploration`}</a></strong></p>
      </div>
    </div>
    <hr></hr>
    <h3 {...{
      "id": "redis-university"
    }}>{`Redis University`}</h3>
    <h3 {...{
      "id": "redis-for-java-developers"
    }}><a parentName="h3" {...{
        "href": "https://university.redislabs.com/courses/ru102j/"
      }}>{`Redis for Java Developers`}</a></h3>
    <p>{`Redis for Java Developers teaches you how to build robust Redis client applications in Java using the Jedis client library. The course focuses on writing idiomatic Java applications with the Jedis API, describing language-specific patterns for managing Redis database connections, handling errors, and using standard classes from the JDK. The course material uses the Jedis API directly with no additional frameworks. As such, the course is appropriate for all Java developers, and it clearly illustrates the principles involved in writing applications with Redis.`}</p>
    <div class="text--center">
      <iframe width="560" height="315" src="https://www.youtube.com/embed/CmQMdJefTjc" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    </MDXLayout>;
}

